import React, { Component } from "react";
import { Link } from "react-router-dom";
import { Navbar } from "react-bootstrap";

const style = {
    padding: '20px',
    marginTop: '10px',
    marginLeft: '0px'
}

class App extends Component {
    render() {
        return (
            <div className="App container">
                <Navbar fluid collapseOnSelect style={style}>
                    <Navbar.Header>
                        <Navbar.Brand>
                            <Link to="/">Scratch</Link>
                        </Navbar.Brand>
                        <Navbar.Toggle />
                    </Navbar.Header>
                </Navbar>
            </div>
        );
    }
}

export default App;
